import React from "react";
import { Link } from "react-router-dom";
import styled from "styled-components";

export const LinkWrap = styled.div`
  height: 100%;
  text-align: center;
  width: 100px;

  div {
    color: white;
    text-decoration: none;
  }
`;

const NavLink = (props) => {
  return (
    <Link to={props.goto}>
      <div>{props.contents}</div>
    </Link>
  );
};

export default NavLink;
